class Solution {
public:
    int minDeletion(vector<int>& nums) {
        int size = nums.size();

        int newi = 0;

        int result = 0;

        for(int i = 0; i< size-1; i++) {
            if (newi%2 == 0 && nums[i] == nums[i+1]) {
                result ++;
            } else {
                newi++;
            }
        }
        if ((size - result)%2 == 1)
            result++;

        return result;
    }
};
